export interface PcpattributeDetailsInner {
    /**
     * The provider ID of the PCp provider.
     */
    pcpProviderId?: string;
    /**
     * The full name of the provider, including a designation, such as John Smith MD.
     */
    pcpProviderFullName?: string;
    /**
     * The Type of the PCP provider.
     */
    pcpType?: string;
    /**
     * The Phone Number of the PCP provider.
     */
    pcpPhoneNumber?: string;
    /**
     * The NPI of the provider.
     */
    providerNPI?: string;
    /**
     * The reason for the PCP Provider change.
     */
    changeReason?: string;
    /**
     * The effective date of the member associate to this primary care doctor. If there is no effective date, then this value is set to the current date. Format is the following:   mm/dd/yyyy    where:   • mm not to exceed 12   • dd not to exceed 31   • yyyy - not less than 1900
     */
    effectiveDate?: string;
    /**
     * The date that the member stopped using this primary care provider. If there is no termination date, then that particular primary care provider is selected for future. Format is the following:   mm/dd/yyyy    where:   • mm not to exceed 12   • dd not to exceed 31   • yyyy - not less than 1900
     */
    terminationDate?: string;
    /**
     * Plan name for member.
     */
    planId?: string;
    /**
     * Plan name for member.
     */
    planName?: string;
    /**
     * panelCode of the PCP.
     */
    panelCode?: string;
    /**
     * The date that the member changed this primary care provider. Format is the following:   mm/dd/yyyy    where:   • mm not to exceed 12   • dd not to exceed 31   • yyyy - not less than 1900
     */
    changeRequestedDate?: string;
}
